import styled from 'styled-components';

export const Top = styled.div`
    display: flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    margin:50px;
    
    img{
        height: 70px;
        width:70px;
        margin:30px
        }
`;
export const Middle = styled.div`
    text-align:center;
    line-height: 2;
    margin-bottom:100px;
`;
export const Bottom = styled.div`
    display: flex;
    flex-direction:column;
    align-items:center;
    justify-content: center;
`;
